IF OBJECT_ID('dbo.proc_transform_320', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_320;
GO
CREATE PROCEDURE dbo.proc_transform_320
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_320
    SET payload = LEFT(payload, 1000) + N'|V4-320|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_320;
END
GO
IF OBJECT_ID('dbo.audit_v4_320', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_320 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_320;
GO

CREATE INDEX IDX_staging_320_payload ON dbo.staging_table_320 (id);
GO
EXEC sp_updatestats;
